request.description:
#### Request Body Scheme

> `{`
> 
> > **data** (*object, required*) `{`
> > 
> > > **type** (*string, required*): **orders**
> > 
> > > **attributes** (*object, required*) `{`
> > > 
> > > > **allow_back_ordering** (*boolean, optional*)  
> > > > Allowing back ordering.
> > > 
> > > > **items** (*Array\[CreateOrderItem\], required*) `[`  
> > > > Order items array.
> > > > 
> > > > > `{`
> > > > > 
> > > > > > **type** (*string*): **did_order_items**
> > > > > 
> > > > > > **attributes** (*object*) `{`
> > > > > > 
> > > > > > > **sku_id** (*string, required*)  
> > > > > > > [Stock Keeping Unit Object](#stock-keeping-unit-object) ID. Should be used with one of optional parameters `qty`, `available_did_id` or `did_reservation_id`.
> > > > > > 
> > > > > > > **qty** (*integer, required*)  
> > > > > > > Quantity if ordering items. Should NOT be used with optional parameters `available_did_id` or `did_reservation_id`.
> > > > > > 
> > > > > > > **did_reservation_id** (*string, optional*)  
> > > > > > > Specific [DID Reservation Object](#did-reservation-object) ID.
> > > > > > 
> > > > > > > **billing_cycles_count** (*integer, optional*)  
> > > > > > > The number of Billing Cycles that this DID Number will renew until expiration.
> > > > > > 
> > > > > > > **available_did_id** (*string, optional*)  
> > > > > > > Specific [Available DID Object](#available-did-object) ID.
> > > > > > 
> > > > > > `}`
> > > > > 
> > > > > `}`
> > > > 
> > > > `]`
> > > 
> > > `}`
> > 
> > `}`
> 
> `}`

