request.description:
Update the settings of a single DID owned by your account. Using this endpoint you can cancel, restore or renew DID.

To cancel a DID, attribute `terminated` must be `true`, to renew or restore DID attribute `terminated` must be `false`.

#### Request Body Scheme

> `{`
> 
> > **data** (*object, required*) `{`
> > 
> > > **id** (*string, required*)  
> > > Unique ID number allocated to this DID.
> > 
> > > **type** (*string, required*): **dids**
> > 
> > > **attributes** (*object, optional*) `{`
> > > 
> > > > **terminated** (*boolean, optional*)  
> > > > If set to `True`, it will cancel a DID number. To renew or restore a DID number, the attribute must be set to `False`.
> > > 
> > > > **pending_removal** (*boolean, optional*)  
> > > > If set to `True`, it will disable automatic DID Renewal. If set to `False`, the DID number will continue renewal.
> > > 
> > > > **description** (*string, optional*)  
> > > > A DID number description.
> > > 
> > > > **billing_cycles_count** (*integer, optional*)  
> > > > The number of Billing Cycles that this DID Number will renew until expiration.  
> > > > If set to `0`, `pending_removal` attribute will change to `True`.  
> > > > If set to `null`, `pending_removal` attribute will change to `False`.  
> > > > Maximum value of `billing_cycles_count` is **999**.
> > > 
> > > > **dedicated_channels_count** (*integer, optional*)  
> > > > Amount of channels to be assigned to curent DID from allocated in relationships Capacity Pool  
> > > > Should be used with one of optional relationship `capacity_pool`
> > > 
> > > `}`
> > 
> > > **relationships** (*object, optional*) `{`
> > > 
> > > > **trunk** (*object, optional*): [***to-one***](#updating-to-one-relationships)  
> > > > Linkage for included [Trunk Object](#trunk-object)
> > > 
> > > > **trunk_group** (*object, optional*): [***to-one***](#updating-to-one-relationships)  
> > > > Linkage for included [Trunk Group Object](#trunk-group-object)
> > > 
> > > > **capacity_pool** (*object, optional*): [***to-one***](#updating-to-one-relationships)  
> > > > Linkage for included [Capacity Pool Object](#capacity-pool-object)
> > > 
> > > > **shared_capacity_group** (*object, optional*): [***to-one***](#updating-to-one-relationships)  
> > > > Linkage for included [Shared Capacity Group Object](#shared-capacity-group-object)
> > > 
> > > `}`
> > 
> > `}`
> 
> `}`

> **Attention**
> 
> Attribute `pending_removal` will become deprecated in the next version of API. It is recommended to use `billing_cycles_count`.

#### Request Body Example:

###### Simple Resource Patch

``` json
{
  "data": {
    "id": "46e129f1-deaa-44db-8915-2646de4d4c70",
    "type": "dids",
    "attributes": {
      "terminated": false,
      "pending_removal": false,
      "description": "string",
      "capacity_limit": 1
    }
  }
}

```
***
###### Assign Trunk

