{
  "data": {
    "id": "3505b18a-3019-47bc-95d1-0f9ec7766fd5",
    "type": "dids",
    "relationships": {
      "trunk": {
        "data": {
          "type": "trunks",
          "id": "c80d096a-c8cf-4449-aa6d-8bac39130fe0"
        }
      }
    }
  }
}

```
