Creates a Shared Capacity Group.

#### Request Body Scheme

> `{`
> 
> > **data** (*object, required*) `{`
> > 
> > > **type** (*string, required*): : **shared_capacity_groups**
> > 
> > > **attributes** (*object, required*) `{`
> > > 
> > > > **name** (*string, NOT nullable, required*)    
> > > > Unique name of Shared Capacity Group.
> > > 
> > > > **shared_channels_count** (*integer, NOT nullable, required*)  
> > > > Unassigned channels quantity to assign to the Shared Capacity Group from the Capacity Pool.
> > > 
> > > > **metered_channels_count** (*integer, NOT nullable, required*)  
> > > > Metered channels quantity to assign to the Shared Capacity Group.
> > > 
> > > `}`
> > 
> > > **relationships** (*object, required/optional*) `{`
> > > 
> > > > **dids** (*object, optional*): [***to-many***](#updating-to-many-relationships)  
> > > > Linkage for included list of [DID Object](#did-object)
> > > 
> > > > **capacity_pool** (*object, required*): [***to-one***](#updating-to-one-relationships)  
> > > > Linkage for included [Capacity Pool Object](#capacity-pool-object)
> > > 
> > > `}`
> > 
> > `}`
> 
> `}`

